import React, { useEffect } from "react";
import "./store_detailspage.css";
import productImage from "../../assets/images/products/product-01.jpg";

const StoreDetails = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <main className="store__product-details store__container">
      <article>
        <figure>
          <img src={productImage} alt="" />
        </figure>
        <article>
          <h1>BLUSA DALTEX</h1>
          <h2>R$ 39.99</h2>
        </article>
      </article>
    </main>
  );
};

export default StoreDetails;
